import React from "react";
import styled from "styled-components";

const StyleTodo = styled.div`
    border: 1px solid red;
    width: 800px;
    height: 1000px;
    margin: auto;
    margin-top: 150px;
`;

const Input = styled.div``;
const Todo = () => {
    return (
        <StyleTodo>
            <div>
                <input></input>
                <button>Enter</button>
            </div>
        </StyleTodo>
    );
};

export default Todo;
